  false,\n\t\"url\": null,\n\t\"notes\": \"This Wildlife Inventory Plan for Horicon
  NWR describes procedures for the following surveys: weekly aerial goose survey,
  migratory bird survey, breeding population survey, brood survey, playback call survey,
  colonial bird nesting survey, mid-winter waterfowl and eagle survey, Christmas bird
  count, may bird count, scent post survey, mourning dove call count, sandhill crane
  breeding survey, aerial deer count, population index based on deer hunt data, ring-necked
  pheasant survey, woodcock singing-ground survey, vegetation and invertebrate abundance,
  aerial sandhill crane production survey, refuge woodcock singing-ground survey,
  and muskrat survey.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
